function setDPIRazer(dpi){
    savedDpi1 = dpi;
    var packet = [];
    packet[0] = 0x00;
    packet[1] = 0x00;
    packet[2] = 0x1F;
    packet[3] = 0x00;
    packet[4] = 0x00;
    packet[5] = 0x00; 
    packet[6] = 0x07;
    packet[7] = 0x04;
    packet[8] = 0x05;
    packet[9] = 0x01; 
    packet[10] = Math.floor(dpi/256);
    packet[11] = dpi%256;
    packet[12] = Math.floor(dpi/256);
    packet[13] = dpi%256;
    packet[89] = CalculateCrc(packet);

    device.send_report(packet, 91);
}
